INSERT INTO `website_course` (`website_course_id`, `course_category_id`, `title`, `description`, `venue`, `schedule`, `amount`, `banner`, `trainner_name`, `trainner_image`, `available_seat`, `who_can_join`, `total_hours`, `start_date`, `end_date`, `created_at`, `updated_at`) VALUES (1,2,'Office Application','The Microsoft Office program is a popular word processing program.\r\nIt is one of the most talked about and popular computer applications in the world. Bill Gates first announced Microsoft Office at an exhibition in Las Vegas in 1986. Although it is made up of many programs, the most commonly used programs are Microsoft Word, Microsoft Excel, and Microsoft PowerPoint.','TMSS INSTITUTE OF SCIENCE & ICT (TISI)','Saturday: 06:00PM -08:00PM \r\nSaturday: 06:00PM -08:00PM \r\nSaturday: 06:00PM -08:00PM ',1500,'img/course/banner1586591253.jpg','MR X','img/course/trainner1586591253.jpg',50,'Anyone!','360 Hours','2020-04-01','2020-04-15','2021-08-16 15:33:00','2020-05-14 05:01:28'),(3,2,'Graphics Design','Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.','TMSS INSTITUTE OF SCIENCE & ICT (TISI)','Saturday: 06:00PM -08:00PM \r\nSaturday: 06:00PM -08:00PM \r\nSaturday: 06:00PM -08:00PM ',2000,'img/course/banner1586237463.jpg','Arif Ahmeed ','img/course/trainner1585975089.jpg',50,'Anyone!','360 Hours','2020-04-01','2020-04-15','2021-08-16 15:33:00','2020-05-14 04:36:36'),(4,3,'Advance Diploma in Microfinance   ','Introduction\r\nMicrofinance has emerged as integral tools for poverty alleviation. The program is continuously developing and is providing support to the microfinance institutes at Nation and international level through Training and experiential learning. Microfinance is defined as financial services for poor and low income clients offered by different type of service providers especially the NGOs. The terms often more narrowly to refer to loans and others services from providers that identifies themselves as Microfinance institutions (MFIs). These institutions tend to use new methods developed over the last 30 years to deliver very small loans to poor and disadvantage section of the community who has no access to formal financial sectors, borrowers with no collateral.  These methods include group as collateral and lending and liability, pre-loan savings requirements, gradually increasing loan size and implicit guarantee to ready access future loans if present loans are repaid fully and promptly. From global perspective, microfinance organization envision a world in which low income households have permanent access to a range of high quality and affordable financial service s offered by MFIs to finance income-producing activity, build assets  stabilize consumption and protect against risks.\r\nKeeping in view the significance of the Microfinance Training TMSS institute of science and ICT (TISI) has designed and developed comprehensive training modules to meet the demands of the MFIs. TISI has vast experience of the training in different sectors all over the country.\r\nObjectives:\r\nAfter completion of the course the students will be able to:\r\n	 Understanding  of  Micro-finance\r\n	What is Microfinance?\r\n	How does it work?\r\n	Microfinance Strategy\r\n	Delinquency Management\r\n	Risk Management\r\n	Internal control & External Audit\r\n	Product Design & Development\r\n	Financial Analysis\r\n	Strategic  Management\r\n	Micro financing\r\n	Microfinance & Microcredit\r\n	Monitoring of Microfinance Programs\r\n	Credit Appraisal & Recovery Techniques (CART)\r\n	Credit Management\r\n	Microfinance/Microcredit Management','TMSS INSTITUTE OF SCIENCE & ICT (TISI)','Every Friday 9:30 am to 1:00 pm',40000,'img/course/banner1589453394.jpg','Md Abu Raihan','img/course/trainner1589453394.jpg',30,'Graduation Completed Person can joined ','360 Hours','2020-01-05','2020-01-08','2021-08-16 15:33:00','2020-05-14 04:49:54'),(5,2,'Proficiency in English Communication ','Background of the Study English is without a doubt the actual universal language said Carlos Carrion Torres of Brazil. While English is not an official language in most countries, it is the language most often taught as a second language. English is most widely used in communicating around the world. The information that the researchers gathered about communication and English made them realized that the two terminologies must be always together. \r\nGood communication creates a good ambiance and relationship between everyone in every organization most especially if it is inside a business while English is now required in every company; as according to Ms. Bambi Bonaventure, Language is now considered a skill, in fact,show more content.\r\nIn the present day workplace, individuals require a range of occupationally specific knowledge and skills, personal attributes and attitudes, the ability to transfer knowledge and skills to different situations, etc. Most industry is quite concerned about the noticeable gap in spoken and written English. \r\nLarge scale surveys of language and literacy skills reveal that the work force needs have to be constantly upgraded in terms of appropriate skills required. The major roadblock that an applicant or a worker must overcome in the global workplace is proficiency in English communication both in oral and written. [2]\r\nEffective English communication will increase productivity in business meetings. From a business outlook, communication is the oil that greases the organizational machine and makes it run easily (Wayne, 1994). Knowing how to communicate to encourage productive action is important. When one cannot communicate effectively, business meetings are unsuccessful.\r\nDespite of the importance of English in every industry, still, many people dont use the language in communicating; not because they dont want to but because they are afraid to have some mistakes while speaking. If you are serious about wanting to give good talks, you must begin to give talks. Anyone who is now good in some activity had once begun at the beginning. And no one is able to do an activity well without practice, work,','TMSS INSTITUTE OF SCIENCE & ICT (TISI)','x',1500,'img/course/banner1589455643.jpg','Arif Ahmeed ','img/course/trainner1589455643.jpg',50,'Anyone ','360 Hours','2020-01-12','2021-01-01','2021-08-16 15:33:00','2020-05-14 05:27:23');
