INSERT INTO `website_setup` (`website_setup_id`, `about_us`, `history`, `overview`, `image`, `mission_vision`, `vision`, `strategy`, `principle_message`, `founder_message`, `chairman_message`, `providan_link`, `academic_calender_link`, `video_link`, `updated_at`) VALUES (1,'The Z. H. Sikder University of Science and Technology a coeducational privately owned university is dedicated to advancing knowledge and educating students in science, technology, and other areas of scholarship that will best serve the nation and the world in the 21st century. The University has been established in 2012 and planned to be organized into four faculties - Humanities and Social Sciences, Life Sciences, Business Studies, and Engineering & Technology. This University is situated at Madhupur Village of Bhadergonj Upazila of Shariatpur district in Southern Bangladesh. It has been established with the passion to make advancement and eradicate poverty of backward southern districts of Bangladesh. Higher education in the right institution can create leadership and entrepreneurship, generate ideas and innovation, empower and breed the students with the confidence to face all real-life challenges. With such a paradigm, the authority of the university envisions an illuminated area surrounding the university. They also believe that the researches in the university will serve the humanity of the country and the planet.\r\n\r\n<p>The University is in a serene and green environment in midst of rich nature. Its infrastructural facilities have made it an exception to other private universities with 6 acres of land and nearly 200000 sft of floor spaces. The students will devote here to study and research activities with full residential accommodation and all other modern learning resources such as a library, internet connectivity, computer lab, etc. ZHSUST is an institution accredited by the University Grants Commission (UGC) and approved by the Ministry of Education, Government of the Peoples Republic of Bangladesh. </p>','The Z. H. Sikder University of Science and Technology  a coeducational privately owned university is dedicated to advancing knowledge and educating students in science, technology, and other areas of scholarship that will best serve to the nation and the world in the 21st century. The University has been established in 2012 and planned to be organized in three faculties  Humanities and Social Sciences, Business Studies, and Engineering & Technology. This University is situated at Madhupur Village of Bhadergonj Upazila of Shariatpur district in Southern Bangladesh. It has been established with the passion to make advancement and eradicate poverty of backward southern districts of Bangladesh. Higher education in the right institution can create leadership and entrepreneurship, generate ideas and innovation, empower and breed the students with the confidence to face all real-life challenges. With such a paradigm, the authority of the university envisions an illuminated area surrounding the university. They also believe that the researches in the university will serve the humanity of the country and the planet. The University is in a serene and green environment in midst of rich nature. Its infrastructural facilities have made it an exception to other private universities with 6 acres of land and nearly 200000 sft of floor spaces. The students will devote here to study and research activities with full residential accommodation and all other modern learning resources such as a library, internet connectivity, computer lab, etc. ZHSUST is an institution accredited by the University Grants Commission (UGC) and approved by the Ministry of Education, Government of the Peoples Republic of Bangladesh.','We believe everyone should have the opportunity to create progress through.','img/backend/overview/1635113639.jpg','The vision of Z. H. Sikder University of Science & Technology is to become a leading university devoted to bringing knowledge and technology to the service of man kind and an abode of excellence in higher education of the country.\r\n\r\n','We believe everyone should have the opportunity to create progress through\r\n                                technology\r\n                                and develop the skills of tomorrow. assessments, learning paths and courses\r\n                                authored. We\r\n                                believe everyone should have the opportunity to create progress through\r\n                                technology\r\n                                and develop the skills of tomorrow. assessments, learning paths and courses\r\n                                authored. We\r\n                                believe everyone should have the opportunity to create progress through\r\n                                technology\r\n                                and develop the skills of tomorrow. assessments, learning paths and courses\r\n                                authored. We\r\n                                believe everyone should have the opportunity to create progress through','We believe everyone should have the opportunity to create progress through\r\n                                technology\r\n                                and develop the skills of tomorrow. assessments, learning paths and courses\r\n                                authored. We\r\n                                believe everyone should have the opportunity to create progress through\r\n                                technology\r\n                                and develop the skills of tomorrow. assessments, learning paths and courses\r\n                                authored. We\r\n                                believe everyone should have the opportunity to create progress through\r\n                                technology\r\n                                and develop the skills of tomorrow. assessments, learning paths and courses\r\n                        